import React from "react";
import {Account} from "./account";
import {Modify} from "./modify";

export class NavbarTweet extends React.Component {
    constructor(props) {
        super(props);
    }

    showModif = (e) => {
        document.getElementById("account").classList.add("d-none");
        document.getElementById("modify").classList.remove("d-none");
    };

    render() {
        return (
            <>
                <nav className="navbar bg-twitter-5 text-white">
                    <a className="navbar-brand">Tweet</a>
                    <a className="nav-item nav-link">Messages</a>
                    <a className="nav-link" onClick={this.showModif}>Account</a>
                    <a className="nav-link">Disconnect</a>
                    <input className="" type="search" placeholder="Search" aria-label="Search"/>
                    <button className="btn btn-twitter-4 " type="submit">Search</button>
                </nav>
                <Account id="account"/>
                <Modify id="modify"/>
            </>
        );
    }
}
